#the following function copies rider_ids.csv into a table.
def populate_ride_ids():
    con = sqlite3.connect("lyft.db")
    cur = con.cursor()
    cur.execute("CREATE TABLE IF NOT EXISTS ride_ids (driver_id, ride_id, ride_distance, ride_duration, ride_prime_time);")
    with open('ride_ids.csv','rb') as fin: # `with` statement available in 2.5+
        # csv.DictReader uses first line in file for column headings by default
        dr = csv.DictReader(fin) # comma is default delimiter
        to_db = [(i['driver_id'], i['ride_id'], i['ride_distance'], i['ride_duration'],i['ride_prime_time']) for i in dr]

    print(to_db[0])   

    cur.executemany("INSERT INTO ride_ids (driver_id, ride_id, ride_distance, ride_duration, ride_prime_time) VALUES (?, ?, ?, ?, ?);", to_db)
    con.commit()
    con.close()
    

#the following function creates all the data necessary for running the linear regression T test
def execute_ride_ids():
    con = sqlite3.connect("lyft.db")
    cur = con.cursor()
    command = "SELECT driver_id, ride_id, ride_distance, ride_duration, ride_prime_time FROM ride_ids"
    to_db = cur.execute(command).fetchall()
    current = 0
    to_db2 = []
    '''following for loop calculates how much money is earned from each ride using the following formula:
    0.25 * ride_prime_time * (2 + (0.22 * ride_duration ) + ( 1.15 * ride_distance)) + 1.75
    this uses the lyft driver earnings estimate equation online: Prime Time *  (Base Fare + (Cost per minute * time in ride) + (Cost per mile * ride distance))
    multiplied by 0.25 which is the percentage Lyft takes on each ride starting 2016 + the Trust and Safety Fee from the Rate Card. 
    The distance and duration are converted to their appropriate units 
    '''
    for entry in to_db:
        current = (((float(entry[4]) / 100) + 1) * (2 + (0.22 * (float(entry[3])/ 60) ) + ( 1.15 * (float(entry[2]) / 1609.34))) + 1.75)
        cur_distance = entry
        if(current < 400):
            to_db2.append(entry)
 
    lyft_profit = 0
    driver_info = {} #this dictionary will be populated like this: {driver_id: [total money made, duration in data, rounding to months, amt of rides per month, total ride duration, total ride distance, total prime time amount, Average acceptance duration ]}
    for entry in to_db2:
        if entry[0] in driver_id:
            lyft_profit = (0.25 * (((float(entry[4]) / 100) + 1) * (2 + (0.22 * (float(entry[3])/ 60) ) + ( 1.15 * (float(entry[2]) / 1609.34)))) + 1.75)
            
            if entry[0] not in driver_info.keys():
                driver_info[entry[0]] = [0, 0, 0, 0, 0, 0, 0, 0]
                driver_info[entry[0]][1] = driver_id[entry[0]]
                driver_info[entry[0]][7] = duration[entry[0]]
                driver_info[entry[0]][2] = driver_id[entry[0]] / 30
                if(driver_id[entry[0]] % 30 > 0):
                    driver_info[entry[0]][2] += 1

            driver_info[entry[0]][0] += lyft_profit
            driver_info[entry[0]][3] += 1
            driver_info[entry[0]][4] += float(entry[3])/ 60
            driver_info[entry[0]][5] += float(entry[2])/ 1609.34
            driver_info[entry[0]][6] += float(entry[4]) / 100
    results = {}
    avg_monthly_rides = 0
    #results -> driverid : avg amount made monthly, duration in days, average amt of rides per month, avg total ride duration per month, avg total ride distance per month, average prime time percentage per month, average monthly acceptance duration
    for entry in driver_info:
        avg_monthly_rides = driver_info[entry][3] / driver_info[entry][2]
        avg_monthly_duration = driver_info[entry][4] / driver_info[entry][2]
        avg_monthly_distance = driver_info[entry][5] / driver_info[entry][2]
        avg_monthly_prime = driver_info[entry][6] / driver_info[entry][2]
        avg_acceptance_duration = driver_info[entry][7] / driver_info[entry][2]
        results[entry] = [(driver_info[entry][0] / driver_info[entry][2]), driver_info[entry][1], avg_monthly_rides, avg_monthly_duration / avg_monthly_rides, avg_monthly_distance / avg_monthly_rides, avg_monthly_prime/ avg_monthly_rides, avg_acceptance_duration / avg_monthly_rides]
    con.commit()
    con.close()
    return results

